import {
  SIGNUP_REQUEST,
  SIGNUP_SUCCESS,
  SIGNUP_ERROR
} from "./Signup.state";

const SignupRequest = ()=>{
  return (dispatch)=>{
    dispatch({
      type: SIGNUP_REQUEST
    })
  }
}

export {
  SignupRequest
}
